/**
 * Takes a packet (represented by an 8-bit number array) and converts it into a `DataView`.
 * 
 * @param packet Packet to convert.
 * @returns `DataView` containing the data from the packet.
 */
export function convertPacketToDataView(packet: number[]): DataView {
  let buffer = new ArrayBuffer(packet.length);
  new Uint8Array(buffer).set(packet);
  return new DataView(buffer);
}

